import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub } from '@fortawesome/free-brands-svg-icons';
import '../App.css';

const MainContent = () => {
    const openPDF=() => {
        window.open('/pictures/Resume-pic.pdf','_blank');
    };

    return (

        <div className="profile-pic-container">
        <div className="profile-pic">
        <img src="/pictures/profile-pic.jpg" alt="Nishanth B M "/>
        </div>
        <div className="profile-text">
        <p className="profile-text-2">Hello I'm</p>
        <h1 className="profile-text-3">Nishanth B M</h1>
        <p className="profile-text-4">Frontend Developer</p>
        <div className="button-container">
            <button className="button-1" onClick={openPDF}>Download CV</button>
            <a href="#Contact" className="button-2">Contact Me</a>
            </div>
            <div className="socials-container">
                 <a href="https://github.com/ni5hanth" target="_blank" rel="noopener noreferrer">
                <img className="icon" src='/pictures/github.png' alt="GitHub" />
                </a>
            </div>
        </div>
        </div>
    );
}

export default MainContent;
